function main(){
    console.log("Start");
    var caCanvas = document.createElement("canvas");
    document.body.appendChild(caCanvas);
    var captcha = document.getElementById('captcha-img');
    caCanvas.width = captcha.naturalWidth;
    caCanvas.height= captcha.naturalHeight;
    var ctx = caCanvas.getContext('2d');
    caCanvas.style.display='none';
    ctx.drawImage(captcha, 0, 0);
    var imgData = ctx.getImageData(0,0,caCanvas.width,caCanvas.height).data;
    var imgGrey = convertToGray(imgData);

    var result = cutWord(imgGrey);

    var recordX = result[0];
    var recordY = result[1];
    var number = result[2];
    /*----------------------------------------*/
    ctx.strokeStyle = 'red';
    /*ctx.lineWidth = 2;*/
    ctx.beginPath();
    for(i=0;i<number;i++){
        ctx.moveTo(recordX[i*2],recordY[i][0]);
        ctx.lineTo(recordX[i*2],recordY[i][1]);
        ctx.moveTo(recordX[i*2+1],recordY[i][0]);
        ctx.lineTo(recordX[i*2+1],recordY[i][1]);
        ctx.stroke();
    }
    for(i=0;i<number;i++){
        ctx.moveTo(recordX[i*2],recordY[i][0]);
        ctx.lineTo(recordX[i*2+1],recordY[i][0]);
        ctx.stroke();
        ctx.moveTo(recordX[i*2],recordY[i][1]);
        ctx.lineTo(recordX[i*2+1],recordY[i][1]);
        ctx.stroke();
    }

    ctx.closePath();

    var imgSet = seperateWord(imgGrey,recordX,recordY,number);
    var max=0;
    var index=0;
    var input=new Array(1);
    var outputArr;
    var output;
    var capForm = document.getElementById('captcha');
    psw = document.getElementById('pass');
    user = document.getElementById('user');
    var str = '';
    var str2 = "";
    for(var i=0;i<number;i++)
    {
        input[0] = reshape(imgSet[i]);
        outputArr = recognize(input);
        output=outputArr[0];
        max=0;
        for(var j=0;j<26;j++)
        {
            if(output[j]>max)
            {
                max=output[j];
                index=j;
            }
        }
        str2 = String.fromCharCode(index+97);
        //console.log(String.fromCharCode(index+97));
        //console.log(str2);
        str = str.concat(str2);
    }
    capForm.value=str;
    console.log(str);
    button = document.getElementsByClassName("btn");
    isAutoLog();
    //drawCut(imgGrey,recordX,recordY,number);
}
function isAutoLog(){
    login = false;
    chrome.storage.sync.get('autoLogin', function(result) {
        login = result['autoLogin'];
        waitClick(login);
    });
}

function waitClick(login) {
    //var login=isAutoLog();
    console.log(login);
    if (login==true&&(psw.value=="" ||psw.value=="undefined"||user.value=="undefined"|| typeof(psw.value)=="undefined" ||typeof(user.value)=="undefined" || user.value=="")) {
        console.log("auto login");
        chrome.storage.sync.get('user', function(result) {
            user.value=result['user'];
            if(user.value=="undefined")
                user.value='';
        });
        chrome.storage.sync.get('pwd', function(result) {
            psw.value=result['pwd'];
            if(psw.value=="undefined")
                psw.value='';
        });
        t = setTimeout("isAutoLog()", 100);
    }
    else if(login==true){
        console.log("clicking!!");
        button[0].click();
        t=setTimeout("judge()",100);
    }
}

function judge() {
    if(document.getElementsByTagName("title")[0].innerText=="上海交通大学统一身份认证") {
        main();
    }
}

/** 在canvas上绘制单字图片，用于调试。可忽略，不影响核心代码。 */
function drawCut(imgGrey,recordX,recordY,number)
{
    //console.log(imgGrey);
    var captcha = document.getElementsByTagName('img')[1];
    var canvasSet = new Array(5);
    var ctxSet = new Array(5);
    var imgDataSet = new Array(5);
    var cnt = 0;
    var x0;
    var y0;
    var dx;
    var dy;

    for(var i=0;i<number;i++)
    {
        canvasSet[i]=document.createElement("canvas");
        document.body.appendChild(canvasSet[i]);
        canvasSet[i].width = captcha.naturalWidth;
        canvasSet[i].height= captcha.naturalHeight;
        ctxSet[i] = canvasSet[i].getContext('2d');
        imgDataSet[i] = ctxSet[i].createImageData(20,25);
    }
    for(var k=0;k<number;k++)
    {
        cnt = 0;
        y=0;
        x0 = recordX[k*2];
        y0 = recordY[k][0];
        dx = recordX[k*2+1]-recordX[k*2];
        dy = recordY[k][1]-recordY[k][0];
        for(x=0;x<20;x++)
        {
            for(y=0;y<25;y++)
            {
                (imgDataSet[k].data)[4*(y*20+x)]=0;
                (imgDataSet[k].data)[4*(y*20+x)+1]=0;
                (imgDataSet[k].data)[4*(y*20+x)+2]=0;
                (imgDataSet[k].data)[4*(y*20+x)+3]=255;

            }
        }
        y=0;
        for(var i=y0;i<=y0+dy;i++)
        {
            x=0;
            //console.log("in decision i");
            for(var j=x0;j<=x0+dx;j++)
            {
                //console.log("in decision j");
                if(imgGrey[i][j]>0)
                {
                    //console.log("is One");
                    (imgDataSet[k].data)[4*(y*20+x)]=255;
                    (imgDataSet[k].data)[4*(y*20+x)+1]=255;
                    (imgDataSet[k].data)[4*(y*20+x)+2]=255;
                    (imgDataSet[k].data)[4*(y*20+x)+3]=255;
                }
                else
                {
                    (imgDataSet[k].data)[4*(y*20+x)]=0;
                    (imgDataSet[k].data)[4*(y*20+x)+1]=0;
                    (imgDataSet[k].data)[4*(y*20+x)+2]=0;
                    (imgDataSet[k].data)[4*(y*20+x)+3]=255;
                }
                x++;
            }
            y++;
        }
        ctxSet[k].putImageData(imgDataSet[k],0,0);
    }
    //console.log(imgDataSet[1]);
}

function convertToGray(imgData) {
    var imgGray = new Array(40);
    for (var i =0;i<40;i++)
    {
        imgGray[i] = new Array(100);
        for(var j=0;j<100;j++)
            imgGray[i][j]=0;
    }
    //convert to grey
    for(var i=0;i<40;i++)
    {
        for(var j=0;j<100;j++)
        {
            //imgGray[i][j]=Math.round((0.2989*imgData[(i*100+j)*4]+0.5870*imgData[(i*100+j)*4+1]+0.1140*imgData[(i*100+j)*4+2]));
            imgGray[i][j]=((0.2989*imgData[(i*100+j)*4]+0.5870*imgData[(i*100+j)*4+1]+0.1140*imgData[(i*100+j)*4+2]));
            //console.log(imgGray[i][j]);
        }
    }
    //console.log(imgData);
    //console.log(imgGray);
    return imgGray;
}

/**返回每个字符的坐标和字符数 */
function cutWord(imgGray)
{
    /**二值化 */
    for(var i=0;i<40;i++){
        for(var j=0;j<100;j++){
            if(imgGray[i][j]>(255*0.71))
                imgGray[i][j] = 0;
            else
                imgGray[i][j] = 1;
        }
    }

    var x = new Array(100);
    var y = new Array(5);
    var number = 0;
    var recordX = new Array(10);
    var recordY = new Array(5);
    var flag;
    /*初始化数组*/
    //----------------------------------------------------------//
    for(i=0;i<100;i++){
        x[i]=0;
    }
    for(i=0;i<5;i++){
        y[i] = new Array(40);
        for(j=0;j<40;j++){
            y[i][j]=0;
        }
    }
    for(i=0;i<5;i++){
        recordY[i] = new Array(2);
        recordY[i][0]=0;
        recordY[i][1]=0;
    }
    for(i=0;i<10;i++){
        recordX[i]=0;
    }
    /*初始化完毕*/
    //----------------------------------------------------------//

    /**横向分离字符，获取字符数和横坐标 */
    for( i=0;i<40;i++){
        for( j=0;j<100;j++){
            x[j]=x[j]+imgGray[i][j];
        }
    }
    flag=0;
    for(i=0;i<100;i++){
        if(flag==0 && x[i]>0){
            flag=1;
            recordX[number*2]=i;
        }
        else if((flag==1 && x[i]==0)||(flag==1 && i==99)){
            flag=0;
            recordX[number*2+1]=i;
            number=number+1;
        }
    }
    /** 纵向分离字符*/
    for(var index=0;index<number;index++){
        flag=0;
        for(i=recordX[index*2];i<=recordX[index*2+1];i++){
            for(j=0;j<40;j++){
                y[index][j]=y[index][j]+imgGray[j][i];
            }
        }
    }
    /** 获取字符纵向坐标*/
    for(index=0;index<number;index++){
        flag=0;
        for(i=0;i<40;i++){
            if(flag==0&&y[index][i]>0){
                flag=1;
                recordY[index][0]=i-1;
            }
        }
        flag=0;
        for(i=39;i>=0;i--){
            if(flag==0&&y[index][i]>0){
                flag=1;
                recordY[index][1]=i+1;
            }
        }
    }
    var result=[recordX,recordY,number];
    return result;
}

/** 返回所有单字的集合 */
function seperateWord(imgGrey,recordX,recordY,number) {
    var imgSet = new Array(5);
    for(var i=0;i<number;i++)
    {
        imgSet[i]=imcrop(imgGrey,recordX[i*2],recordY[i][0],recordX[i*2+1]-recordX[i*2],recordY[i][1]-recordY[i][0]);
    }
    return imgSet;
}

/** 输入图像矩阵、起始坐标及图像横宽，返回裁剪后并适配到25*20大小的图片*/
function imcrop(imgGrey,x0,y0,dx,dy){
    var img = new Array(25);
    for(var i=0;i<25;i++){
        img[i]=new Array(20);
    }
    for(i=0;i<25;i++){
        for(var j=0;j<20;j++){
            img[i][j]=0;
        }
    }
    var x=0;
    var y=0;
    for(i=y0;i<=y0+dy&&x<20;i++){
        x=0;
        for(j=x0;j<=x0+dx&&y<25;j++){
            //console.log(x,y,i,j);
            if(imgGrey[i][j]>0){
                img[y][x]=1;
            }
            else{
                img[y][x]=0;
            }
            x++;
        }
        y++;
    }
    return img;
}

/**将图像重排
 * 返回一维数组*/
function reshape(img){
    var input = new Array(500);
    var cnt = 0;
    for(var i=0;i<25;i++)
    {
        for(var j=0;j<20;j++)
        {
            input[cnt]=img[i][j];
            cnt++;
        }
    }
    return input;
}

